(gt, flush=True)\n\n# Check contract\narrays.check_contract()\n\n# Sign contract\n#arrays.validate_contract()\n\ndef Derivee(F, dx):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{},"id":"1010","type":"LinearScale"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdF
